import { Component } from '@angular/core';
import { AuthService } from 'src/app/services/auth.service';

@Component({
  selector: 'app-sidebar',
  templateUrl: './sidebar.component.html',
  styleUrls: ['./sidebar.component.css']
})
export class SidebarComponent {
  isCollapsed = false;
  userName: string = '';

  items = [
    { title: 'Panorama Biblico', image: 'data:image/jpeg;base64,', description: 'Un apasionante recorrido por toda la biblia y su periodos' },
    { title: 'Solidez Biblica', image: 'data:image/jpeg;base64,', description: 'Estudio sobre diferentes ciencias de la biblia y los inicios de esta' },
    { title: 'Obreros que Dios Necesita', image: 'data:image/jpeg;base64,', description: 'Un estudio sobre Timoteo y como ser un buen obrero de Dios' },
    { title: 'Consolidacion', image: 'data:image/jpeg;base64,', description: 'Sobre las diferentes formas y maneras de consolidar a una persona'},
    { title: 'Obreros que Dios Necesita', image: 'data:image/jpeg;base64,', description: 'Un estudio sobre Timoteo y como ser un buen obrero de Dios' },
  ];

  constructor(private authService: AuthService) {}

  ngOnInit() {
    this.authService.userName$.subscribe((userName) => {
      this.userName = userName;
    });
  }

  toggleSidebar() {
    this.isCollapsed = !this.isCollapsed;
  }

}
